import React, { Component } from 'react'
import Countdown from './Countdown'

class Header extends Component {
	render() {
		return (
			<div className="topheader" id="topHeader">

				<h2>Ashmeet Gill weds Parampal Sandhu</h2>
				<Countdown/>
			</div>
		)
	}
}

export default Header
